    false,nt"url": null,nt"notes": "This annual narrative report for Roanoke
    River National Wildlife Refuge summarizes Refuge activities during the 1993 calendar
    year.  The report begins with a summary of the yearu2019s highlights and climatic
    conditions.  Land acquisition is also covered.  The report includes a planning section
    which discusses the management plan, research, and investigations.  Refuge administration
    is outlined; information about personnel, volunteer programs, funding, safety, and
    technical assistance is given.  Habitat management is also covered.  Subjects include
    wetlands, Farmeru2019s Home Administration Conservation Easements, and private lands.
     The wildlife section of the report discusses wildlife diversity, waterfowl, marsh
    birds, water birds, raptors, game mammals, fisheries resources, and marking/banding.
     The public uses of the Refuge described in this report include outdoor classrooms,
    hunting, camping, and law enforcement.  The equipment and facilities section of
    the report provides information about major maintenance, communications systems,
    and computer systems.  Items of interest are provided at the end.",nt"owner_org":
